module.exports = "\r\n<div class=\"aboutUs\">\r\n<div class=\"container\">\r\n    <div class=\"section\" >\r\n  \r\n      <div class=\"row\">\r\n        <h3 class=\"teal-text\"><b>About Pran Care Psychological Services</b></h3>\r\n        <mat-divider></mat-divider>\r\n      <h4>History</h4>\r\n      <div class=\"card-panel cardpanel\">\r\n          <p>\r\n          \r\n          Prancare is a private psychological and counselling practice founded in 2018. We provide a full\r\n          range of psychological and counselling services for both adults and children.\r\n          Our inception is to become one of the leading providers of private psychological and\r\n          counselling services in India .  Our team of qualified professionals include clinical psychologists,\r\n          child psychologists, educational counsellors, behaviour therapists, Psychiatric social workers and\r\n          Trainers from various fields.\r\n          <br>\r\n          <br>\r\n          Our practice is located in the Murinjapalam,Trivandrum (near GG Hospital) at a discrete and\r\n          private location to ensure your complete confidentiality.  The practice is easily accessible by\r\n          public transport (train or bus) .\r\n        </p>\r\n        </div>\r\n        <mat-divider></mat-divider>\r\n          <h4>Vision</h4>\r\n          <div class=\"card-panel cardpanel\">\r\n<p>\r\nAt Pran Care Psychological Services, we take a\r\nholistic approach to empower individuals by\r\nhelping them address their immediate concerns,\r\nbuilding on their strengths and preparing them to\r\novercome future challenges.\r\n<br>\r\n<br>\r\nWe truly believe that any patient at Pran Care\r\ndeserves nothing less than the best psychological\r\nand counselling services to improve their quality\r\nof life.\r\n</p>\r\n</div>\r\n<mat-divider></mat-divider>\r\n<h4>Our Visionary</h4>\r\n<div class=\"card-panel cardpanel\">\r\n  <p>\r\nPran Nath PS is an unshakable Optimist.He believes that an individual’s greatest potential lies in\r\nacceptance and the ability to grow.</p>\r\n</div>\r\n<mat-divider></mat-divider>\r\n<h4>What to Expect ?</h4>\r\n<div class=\"card-panel cardpanel\">\r\n  <p>\r\nWe Are Mental Health Professionals\r\nPsychology is a recognised and regulated\r\nmental health discipline – in fact, all\r\npsychologists at Pran Care are trained and\r\nexperienced which means we follow a strict\r\ncode of ethics.\r\n<br>\r\n<br>\r\nWhen you visit Pran Care, it should be like a\r\nvisit to any other health professional.\r\nWe Sign a Confidentiality Agreement\r\nBeing a private psychological practice in\r\nTrivandrum , we take confidentiality\r\nseriously and understand the importance of\r\nmaintaining trust of our patients.\r\nWe believe all our patients should feel\r\ncompletely comfortable that Pran Care will never\r\ndisclose any information about them (or their\r\ntherapy) to even family members without the\r\npatient’s prior consent.\r\n<br>\r\n<br>\r\nTo formalise this confidentiality undertaking,\r\nboth patient and psychologist will sign a\r\nconfidentiality agreement at their first meeting.\r\nWe Have a Diverse Team of Psychologists\r\nAll our psychologists and counsellors have been\r\ncarefully selected not only for their professional\r\nqualifications and experience, but also for their\r\npersonality and demeanour.\r\n<br>\r\n<br>\r\nThey offer the highest level of professional\r\nservice to all patients in a warm and\r\naccommodating manner.\r\n<br><br>\r\n\r\nBe Honest with Yourself to Make Progress\r\nWe understand that sometimes very personal\r\ninformation is difficult to share and it may take a\r\nfew sessions to reach a level of trust with your\r\npsychologist.\r\n<br><br>\r\nWe assure you that none of our psychologists or\r\ncounsellors will ever form opinions or judge you\r\nbased on information provided to them – their\r\nsole objective is to consider all information so\r\nthat the best treatment can be delivered.\r\nThe faster a patient can be open in\r\ncommunication, the faster results can be seen.</p>\r\n</div>\r\n<mat-divider></mat-divider>\r\n\r\n<h4>Initial Intake</h4>\r\n<div class=\"card-panel cardpanel\">\r\n  <p>\r\nEvery new patient at Pran Care is required to complete an “initial intake” before commencement of treatment.\r\nThe initial intake appointment will last for around 90 minutes.  The initial intake will be completed by a psychologist or counsellor but is not a therapy session.\r\nThe purpose of the initial intake is for Pran Care to collect relevant background information on the patient (e.g. family history, medical history, personal background) and details of the current presenting concerns and/or issue(s).\r\n</p></div>\r\n<mat-divider></mat-divider>\r\n<h4>First Session Nerves</h4>\r\n<div class=\"card-panel cardpanel\">\r\n  <p>\r\nIt is normal to feel anxious or nervous before seeing a psychologist for the first time.You may even convince yourself that the issue is actually not that bad and you can deal with it later.\r\nWe would encourage patients to take the first step toward resolving rather than avoiding their difficulties. Psychological issues and/or problems left unaddressed will normally build up and return in some form.\r\n</p></div>\r\n        \r\n      </div>\r\n  \r\n    </div>\r\n  </div>\r\n\r\n\r\n</div>"

