module.exports = "\r\n  <div class=\"adult\">\r\n  \r\n  <div class=\"container servicesClass\">\r\n        <div class=\"section\" id=\"services\">\r\n      \r\n          <div class=\"row left-align\">\r\n            <div class=\"col s12 center\">\r\n              <h3><i class=\"mdi-content-send brown-text\"></i></h3>\r\n              <h3 class=\"teal-text\"><b>Adult Services</b> </h3>\r\n              <mat-divider></mat-divider>\r\n              <br>\r\n              <mat-accordion class=\"example-headers-align\">\r\n                  <mat-expansion-panel [expanded]=\"step === 0\" (opened)=\"setStep(0)\" hideToggle>\r\n                    <mat-expansion-panel-header>\r\n                      <mat-panel-title>\r\n                         <b>Psychotherapy and Counselling</b> \r\n                         \r\n                      </mat-panel-title>\r\n                      \r\n                      <mat-panel-description>\r\n                          Click to know more..\r\n                          \r\n                        <mat-icon>arrow_drop_down</mat-icon>\r\n                      </mat-panel-description>\r\n                    </mat-expansion-panel-header>\r\n                <p style=\"text-align:left\" >Pran Care has an experienced team of qualified clinical psychologists that provide both psychotherapy and counselling services.\r\n <br><br>\r\n                        Psychotherapy and counselling is sometimes used interchangeably, but they are different and it is essential that your therapist is appropriately trained for treatment to be effective and safe.\r\n                        <br><br>\r\n                        Psychotherapy is generally a longer term treatment aimed at gaining insight into chronic emotional and/or physical issues. The treatment plan focuses on an individual’s thought processes and overall well-being rather than a specific problem.\r\n                        Counselling is normally a shorter term series of therapy with focus on a specific problem or symptom which the individual needs guidance on how to resolve or manage.\r\n                        Through our mandatory initial intake process, we take great care ensuring all new patients are matched with the most appropriate Pran Care psychologist or counsellor. We consider this matching process essential to providing patients the best quality care as it allows us to allocate the most appropriate therapist to you.\r\n                        Pran Care has helped people overcome a wide range of issues.  This is not an exhaustive list, but typical presenting concerns faced by our patients seeking psychotherapy or counselling services include:\r\n                        \r\n                </p>\r\n          <mat-list role=\"list\">\r\n                              <mat-list-item role=\"listitem\">1. Anger Management</mat-list-item>\r\n                              <mat-divider></mat-divider>\r\n                              <mat-list-item role=\"listitem\">2. Anxiety</mat-list-item>\r\n                              <mat-divider></mat-divider>\r\n                              <mat-list-item role=\"listitem\">3. Confidence and Self Esteem</mat-list-item>\r\n                              <mat-divider></mat-divider>\r\n                              <mat-list-item role=\"listitem\">4. Depression</mat-list-item>\r\n                              <mat-divider></mat-divider>\r\n                              <mat-list-item role=\"listitem\">5. Drug and Alcohol Addiction\r\n                                </mat-list-item>\r\n                                <mat-divider></mat-divider>\r\n                              <mat-list-item role=\"listitem\">6. Eating Disorders</mat-list-item>\r\n                            \r\n                            <mat-divider></mat-divider>\r\n                            <mat-list-item role=\"listitem\">7. Expatriate and Relocation Issues</mat-list-item>\r\n                              <mat-divider></mat-divider>\r\n                              <mat-list-item role=\"listitem\">8. Gambling Addiction</mat-list-item>\r\n                              <mat-divider></mat-divider>\r\n                              <mat-list-item role=\"listitem\">9. Grief and loss\r\n                                </mat-list-item>\r\n                              <mat-divider></mat-divider>\r\n                              <mat-list-item role=\"listitem\">10. Internet addictions (including gaming, social media & pornography)\r\n                                </mat-list-item>\r\n                              <mat-divider></mat-divider>\r\n                              <mat-list-item role=\"listitem\">11. Obsessive Compulsive Disorder</mat-list-item>\r\n                                    <mat-divider></mat-divider>\r\n                                    <mat-list-item role=\"listitem\">12. Mood Disorders\r\n                                      </mat-list-item>\r\n                                    <mat-divider></mat-divider>\r\n                                    <mat-list-item role=\"listitem\">13. Personality Disorder\r\n\r\n                                </mat-list-item>\r\n                                <mat-divider></mat-divider>\r\n                                    <mat-list-item role=\"listitem\">14. Phobia\r\n                                      </mat-list-item>\r\n                                    <mat-divider></mat-divider>\r\n                                    <mat-list-item role=\"listitem\">15. Relationships</mat-list-item>\r\n                                            <mat-divider></mat-divider>\r\n                                            <mat-list-item role=\"listitem\">16. Sexuality Issues\r\n\r\n                                              </mat-list-item>\r\n                                            <mat-divider></mat-divider>\r\n                                            <mat-list-item role=\"listitem\">17. Sexual Difficulties\r\n\r\n</mat-list-item>\r\n                                                    <mat-divider></mat-divider>\r\n                                                    <mat-list-item role=\"listitem\">18. Stress Management\r\n                                                      </mat-list-item>\r\n                                                    <mat-divider></mat-divider>\r\n                                                    <mat-list-item role=\"listitem\">19. Wellbeing and Performance\r\n                \r\n\r\n                                </mat-list-item>\r\n                            </mat-list>\r\n                    <mat-action-row>\r\n                      <button mat-button color=\"primary\" (click)=\"nextStep()\">Next</button>\r\n                    </mat-action-row>\r\n                  </mat-expansion-panel>\r\n                \r\n                  <mat-expansion-panel [expanded]=\"step === 1\" (opened)=\"setStep(1)\" hideToggle>\r\n                      <mat-expansion-panel-header>\r\n                          <mat-panel-title>\r\n                             <b>Couples Therapy\r\n                                </b> \r\n                          </mat-panel-title>\r\n                          <mat-panel-description>\r\n                              Click to know more..\r\n                              \r\n                            <mat-icon>arrow_drop_down</mat-icon>\r\n                          </mat-panel-description>\r\n                        </mat-expansion-panel-header>\r\n                    <p style=\"text-align:left\">It is not uncommon for a couple to disagree on an important decision, causing conflicts that may lead to disagreements, broken communication and/or dissolve the unity of the relationship.  Couples Therapy can help bridge the gap and restore balance in a relationship.\r\n                            There are many reasons why this situation might arise, including, partners not being honest with each other (which may include infidelity), lack of communication, or maybe one (or both) partners have changed their views on one another.\r\n                            If couples can openly talk and listen about the issues and concerns with an open mind, many of these situations can be resolved through couples therapy.\r\n                            Approach to couples therapy varies depending on the situation but may include joint counselling sessions with both partners present complemented with individual sessions for each partner.\r\n                            Typical issues we have helped couples overcome at Think Psychological Services include:\r\n                            \r\n                       \r\n                        \r\n              </p>\r\n              <mat-list role=\"list\">\r\n                                  <mat-list-item role=\"listitem\">1. Communications issues\r\n                                    </mat-list-item>\r\n                                  <mat-divider></mat-divider>\r\n                                  <mat-list-item role=\"listitem\">2. Divorce and separation</mat-list-item>\r\n                                  <mat-divider></mat-divider>\r\n                                  <mat-list-item role=\"listitem\">3. Divorce and co-parenting\r\n                                    </mat-list-item>\r\n                                  <mat-divider></mat-divider>\r\n                                  <mat-list-item role=\"listitem\">4. Extended family issues\r\n                                    </mat-list-item>\r\n                                  <mat-divider></mat-divider>\r\n                                  <mat-list-item role=\"listitem\">5. Falling out of love\r\n                                    </mat-list-item>\r\n                                    <mat-divider></mat-divider>\r\n                                  <mat-list-item role=\"listitem\">6. Infidelity and flirting with others\r\n                                    </mat-list-item>\r\n                                  <mat-divider></mat-divider>\r\n                                  <mat-list-item role=\"listitem\">7. Intimacy issues\r\n                                    </mat-list-item>\r\n                                  <mat-divider></mat-divider>\r\n                                  <mat-list-item role=\"listitem\">8. Financial related issues</mat-list-item>\r\n                                  <mat-divider></mat-divider>\r\n                                  <mat-list-item role=\"listitem\">9. Marriage counselling\r\n                                    </mat-list-item>\r\n                                  <mat-divider></mat-divider>\r\n                                  <mat-list-item role=\"listitem\">10. Pre-marital issues\r\n                                    </mat-list-item>\r\n                                    <mat-divider></mat-divider>\r\n                                  <mat-list-item role=\"listitem\">11. Relationship counselling\r\n\r\n                                    </mat-list-item>\r\n                                  <mat-divider></mat-divider>\r\n                                  <mat-list-item role=\"listitem\">12. Sexuality issues\r\n                                    </mat-list-item>\r\n                                </mat-list>\r\n                        \r\n                                <mat-action-row>\r\n                                    <button mat-button color=\"warn\" (click)=\"prevStep()\">Previous</button>\r\n                                    <button mat-button color=\"primary\" (click)=\"nextStep()\">Next</button>\r\n                                  </mat-action-row>\r\n                  </mat-expansion-panel>\r\n                \r\n                  <mat-expansion-panel [expanded]=\"step === 2\" (opened)=\"setStep(2)\" hideToggle>\r\n                      <mat-expansion-panel-header>\r\n                          <mat-panel-title>\r\n                             <b>Family Therapy\r\n                              </b> \r\n                          </mat-panel-title>\r\n                          <mat-panel-description>\r\n                              Click to know more..\r\n                              \r\n                            <mat-icon>arrow_drop_down</mat-icon>\r\n                          </mat-panel-description>\r\n                        </mat-expansion-panel-header>\r\n                    <p style=\"text-align:left\">Family therapy normally involves the whole family, or several family members, meeting with a counsellor or psychologist to discuss presenting issues.\r\n                            Family therapy is helpful in situations where the family system has been disrupted.  This may be a result of a problem of a single family member or multiple family members, where the issue is related or completely different.\r\n                            The aim of family therapy is not to place blame on a single family member but rather to change overall family interaction or behaviour to help resolve the concern.\r\n                            Typical situations we see at Pran Care include:\r\n                            \r\n    \r\n                       \r\n                        \r\n              </p>\r\n              <mat-list role=\"list\">\r\n                                  <mat-list-item role=\"listitem\">1. Conflict between family members\r\n                                    </mat-list-item>\r\n                                    <mat-divider></mat-divider>\r\n                                  <mat-list-item role=\"listitem\">2. Illness of a family member\r\n                                    </mat-list-item>\r\n                                  <mat-divider></mat-divider>\r\n                                  <mat-list-item role=\"listitem\">3. Re-marriage and acceptance\r\n\r\n                                    </mat-list-item>\r\n                                    <mat-divider></mat-divider>\r\n                                  <mat-list-item role=\"listitem\">4. Sibling relationships</mat-list-item>\r\n                                  <mat-divider></mat-divider>\r\n                                  <mat-list-item role=\"listitem\">5. Parent and adult children relationships\r\n                                    </mat-list-item>\r\n                                    <mat-divider></mat-divider>\r\n                                  <mat-list-item role=\"listitem\">6. Grief and loss</mat-list-item>\r\n                        </mat-list>\r\n                                <mat-action-row>\r\n                                    <button mat-button color=\"warn\" (click)=\"prevStep()\">Previous</button>\r\n                                    <button mat-button color=\"primary\" (click)=\"nextStep()\">Next</button>\r\n                                  </mat-action-row>\r\n                  </mat-expansion-panel>\r\n    \r\n                  <mat-expansion-panel [expanded]=\"step === 3\" (opened)=\"setStep(3)\" hideToggle>\r\n                      <mat-expansion-panel-header>\r\n                          <mat-panel-title>\r\n                             <b>LGBT Counselling\r\n                              </b> \r\n                          </mat-panel-title>\r\n                          <mat-panel-description>\r\n                              Click to know more..\r\n                              \r\n                            <mat-icon>arrow_drop_down</mat-icon>\r\n                          </mat-panel-description>\r\n                        </mat-expansion-panel-header>\r\n                    <p style=\"text-align:left\">Pran Care provides specialised LGBT counselling services for lesbian, gay, bisexual and transgender individuals and couples.\r\n                            Being a private practice which prides itself on confidentiality, our psychologists and counsellors have significant experience helping LGBT individuals and couples work through a wide range of issues including:\r\n                            \r\n    \r\n    \r\n                       \r\n                        \r\n              </p>\r\n                  <mat-list role=\"list\">\r\n                        <mat-list-item role=\"listitem\">1. Coming out process\r\n                          </mat-list-item>\r\n                          <mat-divider></mat-divider>\r\n                        <mat-list-item role=\"listitem\">2. Discrimination\r\n                          </mat-list-item>\r\n                        <mat-divider></mat-divider>\r\n                        <mat-list-item role=\"listitem\">3. Fidelity issues\r\n\r\n\r\n                          </mat-list-item>\r\n                          <mat-divider></mat-divider>\r\n                        <mat-list-item role=\"listitem\">4. National service support\r\n                            </mat-list-item>\r\n                        <mat-divider></mat-divider>\r\n                        <mat-list-item role=\"listitem\">5. Parents dealing with LGBT child\r\n\r\n                          </mat-list-item>\r\n                          <mat-divider></mat-divider>\r\n                        <mat-list-item role=\"listitem\">6. Relationships</mat-list-item>\r\n                        <mat-divider></mat-divider>\r\n                        <mat-list-item role=\"listitem\">7. Sexual identity\r\n\r\n                            </mat-list-item>\r\n                        <mat-divider></mat-divider>\r\n                        <mat-list-item role=\"listitem\">8. Social issues\r\n\r\n\r\n                          </mat-list-item>\r\n                          <mat-divider></mat-divider>\r\n                        <mat-list-item role=\"listitem\">9. Work environment issues\r\n                            </mat-list-item>\r\n              </mat-list>\r\n                        \r\n                                <mat-action-row>\r\n                                    <button mat-button color=\"warn\" (click)=\"prevStep()\">Previous</button>\r\n                                    <button mat-button color=\"primary\" (click)=\"nextStep()\">End</button>\r\n                                  </mat-action-row>\r\n                  </mat-expansion-panel>\r\n                \r\n                </mat-accordion>\r\n                \r\n              \r\n            </div>\r\n          </div>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n          <div class=\"row left-align\">\r\n                <div class=\"col s12 center\">\r\n                  <h3><i class=\"mdi-content-send brown-text\"></i></h3>\r\n                  <h3 class=\"teal-text\"><b>Child Services</b> </h3>\r\n                  <mat-divider></mat-divider>\r\n                  <br>\r\n                  <mat-accordion class=\"example-headers-align\">\r\n                      <mat-expansion-panel [expanded]=\"step === 4\" (opened)=\"setStep(4)\" hideToggle>\r\n                        <mat-expansion-panel-header>\r\n                          <mat-panel-title>\r\n                             <b style=\"font-family: roboto\">Counselling and Therapy</b> \r\n                             \r\n                          </mat-panel-title>\r\n                          \r\n                          <mat-panel-description>\r\n                              Click to know more..\r\n                              \r\n                            <mat-icon>arrow_drop_down</mat-icon>\r\n                          </mat-panel-description>\r\n                        </mat-expansion-panel-header>\r\n                    <p style=\"text-align:left\" >The main difference between counselling for children\r\n                            and adults is the need to alter therapy to allow for the\r\n                            child’s level of cognitive and emotional development. \r\n                            This includes the fact that children may not be strong\r\n                            in verbal communication and are less likely to realise\r\n                            they are experiencing difficulties on their own.\r\n                            At Pran Care we have a team of child psychologist\r\n                            (both clinical, educational &amp; developmental) and\r\n                            counsellors who specialise in children.  This allows us\r\n                            to offer a full suite of psychological services for\r\n                            children ranging from counselling to assessment /\r\n                            diagnosis to intervention recommendations and other\r\n                            intervention services.\r\n                            <br><br>\r\n                            At Pran Care, we take a holistic approach to our child psychologist services which involves working\r\n                            closely with not only the child, but also their family, school .\r\n                            Many parents seek our child psychologist services for a wide range of psychological and behaviour\r\n                            issues, inluding:\r\n                    </p>\r\n              <mat-list role=\"list\">\r\n                                  <mat-list-item role=\"listitem\">1. Autism Spectrum Disorder</mat-list-item>\r\n                                  <mat-divider></mat-divider>\r\n                                  <mat-list-item role=\"listitem\">2. ADHD (Attention Deficit Hyperactive Disorder)\r\n                                    </mat-list-item>\r\n                                  <mat-divider></mat-divider>\r\n                                  <mat-list-item role=\"listitem\">3. Anxiety</mat-list-item>\r\n                                  <mat-divider></mat-divider>\r\n                                  <mat-list-item role=\"listitem\">4. Behaviour Management</mat-list-item>\r\n                                  <mat-divider></mat-divider>\r\n                                  <mat-list-item role=\"listitem\">5. Conduct Disorder\r\n                                    </mat-list-item>\r\n                                    <mat-divider></mat-divider>\r\n                                  <mat-list-item role=\"listitem\">6. Depression</mat-list-item>\r\n                                \r\n                                <mat-divider></mat-divider>\r\n                                <mat-list-item role=\"listitem\">7. Dyslexia\r\n                                    </mat-list-item>\r\n                                  <mat-divider></mat-divider>\r\n                                  <mat-list-item role=\"listitem\">8. Gaming Addiction</mat-list-item>\r\n                                  <mat-divider></mat-divider>\r\n                                  <mat-list-item role=\"listitem\">9. Giftedness\r\n                                    </mat-list-item>\r\n                                  <mat-divider></mat-divider>\r\n                                  <mat-list-item role=\"listitem\">10. Global Development Delay\r\n\r\n                                    </mat-list-item>\r\n                                  <mat-divider></mat-divider>\r\n                                  <mat-list-item role=\"listitem\">11. Intellectual Disability\r\n                                    </mat-list-item>\r\n                                        <mat-divider></mat-divider>\r\n                                        <mat-list-item role=\"listitem\">12. Internet Addiction\r\n\r\n                                          </mat-list-item>\r\n                                        <mat-divider></mat-divider>\r\n                                        <mat-list-item role=\"listitem\">13. Learning Disorders (e.g. Dyscalculia and Dysgraphia)\r\n\r\n    \r\n                                    </mat-list-item>\r\n                                    <mat-divider></mat-divider>\r\n                                        <mat-list-item role=\"listitem\">14. Mood Disorders\r\n                                          </mat-list-item>\r\n                                        <mat-divider></mat-divider>\r\n                                        <mat-list-item role=\"listitem\">15. Oppositional Defiant Disorder\r\n                                            </mat-list-item>\r\n                                                <mat-divider></mat-divider>\r\n                                                <mat-list-item role=\"listitem\">16. Restrictive Eating\r\n    \r\n                                                  </mat-list-item>\r\n                                                <mat-divider></mat-divider>\r\n                                                <mat-list-item role=\"listitem\">17. Selective Mutism\r\n    \r\n    </mat-list-item>\r\n                                                        <mat-divider></mat-divider>\r\n                                                        <mat-list-item role=\"listitem\">18. Sexuality Issues\r\n\r\n                                                          </mat-list-item>\r\n                                </mat-list>\r\n                        <mat-action-row>\r\n                          <button mat-button color=\"primary\" (click)=\"nextStep()\">Next</button>\r\n                        </mat-action-row>\r\n                      </mat-expansion-panel>\r\n                    \r\n                      <mat-expansion-panel [expanded]=\"step === 5\" (opened)=\"setStep(5)\" hideToggle>\r\n                          <mat-expansion-panel-header>\r\n                              <mat-panel-title>\r\n                                 <b>Behaviour Management\r\n                                    </b> \r\n                              </mat-panel-title>\r\n                              <mat-panel-description>\r\n                                  Click to know more..\r\n                                  \r\n                                <mat-icon>arrow_drop_down</mat-icon>\r\n                              </mat-panel-description>\r\n                            </mat-expansion-panel-header>\r\n                        <p style=\"text-align:left\">Pran Care, takes a developmental approach to behaviour management and intervention.\r\n                                We understand that every child is different and requires a customised program.\r\n                                We utilise a number of evidence-based methods in our behaviour management programs as noted below.\r\n                               <br><i><b>Applied Behavioural Analysis (ABA)</b> </i><br>\r\n                                Pran Care is an advocate of Lovaas-style ABA, which involves discrete trial training. This training addresses social, motor, verbal behaviours as well as reasoning skills. This form of ABA focuses on reinforcing the behaviour we want.\r\n                                ABA is evidence based and has been proven to provide the best results for behaviour management in children with Autism, related disorders and other challenging behaviours..\r\n                              <br> <i><b>Social Skills Group Training</b></i> <br>\r\n                                Pran Care provide social skills group training for children with special needs and/or challenging behaviors. All social skills training at Pran Care employs evidence-based methods proven to teach children how to engage, respond and regulate social interactions with their peers and community.\r\n                                All social skills groups are kept to a small number of participants of similar age and complementary profile. The social skills training sessions will include structured activities such as therapist-guided games, role-plays, discussions, worksheets and video feedback. The activities will be targeted in helping your child to gain awareness on why the skills are necessary, as well as giving him/her a chance to practice them in class.\r\n                               <br><i><b>Cognitive Behaviour Therapy (CBT)</b></i> <br>\r\n                                CBT is a psychotherapeutic approach, aimed at addressing dysfunctional thoughts, behaviours or emotions. The fundamental concept behind CBT is that an individual’s thoughts and feelings play a basic role in our behaviour and by adjusting how we view and deal with things in the environment; we can then modify our thoughts and actions.\r\n                                \r\n                           \r\n                            \r\n                  </p>\r\n                                    <mat-action-row>\r\n                                        <button mat-button color=\"warn\" (click)=\"prevStep()\">Previous</button>\r\n                                        <button mat-button color=\"primary\" (click)=\"nextStep()\">Next</button>\r\n                                      </mat-action-row>\r\n                      </mat-expansion-panel>\r\n                    \r\n                    \r\n                    </mat-accordion>\r\n                    \r\n                  \r\n                </div>\r\n              </div>\r\n      \r\n        </div>\r\n      </div>\r\n      \r\n    </div>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n      \r\n      \r\n      \r\n      "

